// App.js
import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom'; // Import BrowserRouter and Route
import LoginSignup from './components/LoginSignup/LoginSIgnup';
import Home from './Home';

function App() {
  return (
    <Router> {/* Wrap your components with BrowserRouter */}
      <div>
        <Route exact path="/" component={LoginSignup} /> {/* Define route for LoginSignup component */}
        <Route path="/home" component={Home} /> {/* Define route for Home component */}
      </div>
    </Router>
  );
}

export default App;
